import React from 'react';
import { NavLink } from 'react-router-dom';
import c from './Dialogs.module.css';

const DialogItem = (props) => {
    let path = "/dialog/" + props.id;
    return (
        <div className={c.dialog + ' ' + c.active}>
            <NavLink to={path}>{props.name}</NavLink>
        </div>
    )
}

const Dialogs = () => {
    return (
        <div className={c.dialogs}>
            <div className={c.dialogsItems}>
                <DialogItem name="Natalie" id="1" />
                <div className={c.dialog}>
                    <NavLink to="/dialog/2">Dora</NavLink>
                </div>
                <div className={c.dialog}>
                    <NavLink to="/dialog/3">Knara</NavLink>
                </div>
                <div className={c.dialog}>
                    <NavLink to="/dialog/4">Nastya</NavLink>
                </div>
                <div className={c.dialog}>
                    <NavLink to="/dialog/5">Tanya</NavLink>
                </div>
                <div className={c.dialog}>
                    <NavLink to="/dialog/6">Ola</NavLink>
                </div>
            </div>
            <div className={c.messages}>
                <div className={c.message}>Hey!</div>
                <div className={c.message}>Hallo!</div>
                <div className={c.message}>Hi!</div>
            </div>
        </div>
    )
}

export default Dialogs;
